const dummy_data = [
	{
		id: "id-1",
		location: "nyc",
		image: "https://duckduckgo.com/i/b560ca3e.jpg",
		description: "statue of liberty",
	},
	{
		id: "id-2",
		location: "sf",
		image: "https://duckduckgo.com/i/2b0feb03.jpg",
		description: "golden gate bridge",
	},
];

function AllMeetupsPage() {
	return (
		<section>
			<div>All Meetups</div>
			<ul>
				{dummy_data.map((meetup) => {
					return <li>{meetup.location}: <img style={{height:"96px", width:"96px"}} alt='' src="{meetup.image}"/></li>;
				})}
			</ul>
		</section>
	);
}
export default AllMeetupsPage;
